import React from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'



function Repos_url() {
const params = useParams()

  const test = () => {
    axios.get(`https://api.github.com/users/${params}/repos`)
      .then((res) => {

        console.log(res.data)
      }).catch((err) => {
        alert(err)

      })
  }
  
  return (
      <div>
   repositorio
      </div>
    );
  }
  
  export default Repos_url;
